  \"2015-07-23T03:30:34.015597\",\n\t\"name\": \"evaluation-of-the-effects-of-loss-of-water-for-use-by-waterfowl-and-other-wildlife-in-the-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This report summarizes a two phase study
  of Lahontan Valley wildlife areas. The purpose of Phase I was to determine the total
  waterfowl use area in the Lahontan Valley. The data compiled in Phase I will be
  used in evaluating the effect of water cutback to these areas and the resultant
  impact on waterfowl production and migration. The purpose of Phase II was to evaluate
  the effect of loss or reduction in water supply to the wetlands of the Lahontan
  Valley and to investigate and recommend ways to offset the effects. It has been
  assumed in compiling this report that water reductions will occur either through
  limitation of water supply to the Newlands Project or by increasing the efficiency
  of the Project water supply system through certain physical changes.\",\n\t\"license_title\":
